const { width, height } = Dimensions.get("window");

const CurrentChallenges = (props) => {
  const [active, setActive] = useState(true);
  const [recent, setRecent] = useState(false);

  const [curChallenges, setCurrChallenges] = useState([]);
  const [pastChallenges, setPastChallenges] = useState([]);

  useEffect(() => {
    setCurrChallenges(curChallenge);
    setPastChallenges(pastChallenge);
  }, []);

  return (
    <SafeAreaView style={{ flex: 1 }}>
      <ScrollView showsVerticalScrollIndicator={false}>
        <View style={styles.backgroundPillContainer}>
          <Pill
            options={["Active", "Past"]}
            callback={setRecent}
            recent={recent}
          />
        </View>
        {recent ? (
          <FlatList
            data={curChallenges}
            renderItem={({ item }) => {
              return (
                <TouchableOpacity
                  onPress={() =>
                    props.navigation.navigate("ChallengeInformation", {
                      challenge: item,
                    })
                  }
                >
                  <ChallengeBox
                    current={true}
                    title={item.title}
                    description={item.shortDescr}
                    image={item.image}
                    status={item.status}
                  />
                </TouchableOpacity>
              );
            }}
            keyExtractor={(item) => item.id}
          />
        ) : (
          <FlatList
            data={pastChallenges}
            renderItem={({ item }) => {
              return (
                <TouchableOpacity
                  onPress={() =>
                    props.navigation.navigate("ChallengeInformation", {
                      challenge: item,
                    })
                  }
                >
                  <ChallengeBox
                    past={true}
                    title={item.title}
                    description={item.shortDescr}
                    image={item.image}
                    status={item.status}
                  />
                </TouchableOpacity>
              );
            }}
            keyExtractor={(item) => item.id}
          />
        )}
      </ScrollView>
    </SafeAreaView>
  );
};

